    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Dismal Swamp National Wildlife Refuge outlines Refuge accomplishments during the
    1995 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses the management plan, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, volunteer programs, funding, and safety is given. Habitat
    management is also covered; subjects include wetlands, forests, fire management,
    and wilderness and special areas. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, other migratory birds, game mammals, other resident wildlife,
    and fisheries resources. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, fishing, wildlife observation,
    other wildlife oriented recreation, other non-wildlife oriented recreation, and
    law enforcement. The equipment and facilities section of the report provides information
    about rehabilitation, major maintenance, equipment utilization and replacement,
    communication systems, and computer systems. Cooperative programs and items of interest
    are provided at the end. A brief narrative report on Nansemond National Wildlife
    Refuge is included. Photographs and Refuge brochures are attached.",nt"owner_org":
